import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import { Provider } from 'react-redux';

// Redux store
import store from './redux/store';

// App layout components
import ScrollToTop from './components/layout/ScrollToTop';
import Navbar from './components/layout/Navbar';
import Alerts from './components/layout/Alerts';
import Footer from './components/layout/Footer';

// App pages
import Home from './components/pages/Home';
import Login from './components/auth/Login';
import Profile from './components/pages/Profile';
import AddRequest from './components/pages/posts/Requests/AddRequest';
import RequestsPage from './components/pages/posts/Requests/RequestsPage';
import RequestShow from './components/pages/posts/Requests/RequestShow';
import AddOfferRequest from './components/pages/posts/Offers/AddOfferRequest';
import OffersPage from './components/pages/posts/Offers/OffersPage';
import OfferShow from './components/pages/posts/Offers/OfferShow';


// Routes
import PrivateRoute from './components/routing/PrivateRoute';

import './App.css';

function App() {
  return (
    <Router>
      <Provider store={store}>
        <ScrollToTop />
        <div className='App'>
          <Navbar />
          <div className='container'>
            <Alerts />
            <Switch>

              <Route exact path='/login' component={Login} />
              <PrivateRoute exact path='/profile' component={Profile} />
              <Route exact path='/profile' component={Profile} />
              <PrivateRoute exact path='/requests/add' component={AddRequest} />
              <Route exact path='/requests' component={RequestsPage} />
              <Route exact path='/requests/:id' component={RequestShow} />

              <PrivateRoute
                exact
                path='/Offers/add'
                component={AddOfferRequest}
              />
              <Route exact path='/Offers' component={OffersPage} />
              <Route exact path='/Offers/:id' component={OfferShow} />

              <Route component={Home} />
            </Switch>
          </div>
          <Footer />
        </div>
      </Provider>
    </Router>
  );
}

export default App;
